<script>
/**
 * @param {number} left
 * @param {number} right
 * @return {number[]}
 */
var selfDividingNumbers = function(left, right) {
	var res=[];
    for(var i=left;i<=right;i++){
    	if(aAronDie(i)){
    		res.push(i);
    	};
    };
    console.log(res);
    return res;
};
function aAronDie(num){
	var arr=num.toString().split('');
	for(var i in arr){
		if(num%(arr[i]*1)!=0){
			return false;
		};
	};
	return true;
};
var res=new selfDividingNumbers(1,22);
